import React, { useState } from 'react';
import { useCart } from '../context/CartContext';
import { FaStar, FaShoppingCart, FaEye } from 'react-icons/fa';
import { toast } from 'react-toastify';

const ProductCard = ({ product }) => {
  const { addItem } = useCart();
  const [isHovered, setIsHovered] = useState(false);

  const handleAddToCart = () => {
    addItem(product);
    toast.success(`${product.name} added to cart!`, {
      position: "bottom-right",
      autoClose: 2000,
    });
  };

  const renderStars = (rating) => {
    const stars = [];
    const fullStars = Math.floor(rating);
    const hasHalfStar = rating % 1 !== 0;

    for (let i = 0; i < fullStars; i++) {
      stars.push(<FaStar key={i} className="text-yellow-500" />);
    }

    if (hasHalfStar) {
      stars.push(<FaStar key="half" className="text-yellow-500 opacity-50" />);
    }

    const emptyStars = 5 - Math.ceil(rating);
    for (let i = 0; i < emptyStars; i++) {
      stars.push(<FaStar key={`empty-${i}`} className="text-gray-300" />);
    }

    return stars;
  };

  return (
    <div 
      className="product-card group"
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >
      {/* Product Image */}
      <div className="relative overflow-hidden rounded-lg mb-4">
        <img
          src={product.image}
          alt={product.name}
          className="w-full h-48 object-cover transition-transform duration-300 group-hover:scale-110"
        />
        
        {/* Overlay with quick actions */}
        <div className={`absolute inset-0 bg-black bg-opacity-50 flex items-center justify-center transition-opacity duration-300 ${
          isHovered ? 'opacity-100' : 'opacity-0'
        }`}>
          <div className="flex space-x-2">
            <button className="bg-white text-automotive-dark p-2 rounded-full hover:bg-automotive-orange hover:text-white transition-colors">
              <FaEye />
            </button>
            <button 
              onClick={handleAddToCart}
              className="bg-automotive-orange text-white p-2 rounded-full hover:bg-orange-600 transition-colors"
            >
              <FaShoppingCart />
            </button>
          </div>
        </div>

        {/* Vendor Badge */}
        <div className="absolute top-2 left-2">
          <span className="vendor-badge text-xs">
            {product.vendor}
          </span>
        </div>
      </div>

      {/* Product Info */}
      <div className="space-y-2">
        <h3 className="font-semibold text-lg text-automotive-dark group-hover:text-automotive-orange transition-colors">
          {product.name}
        </h3>
        
        {/* Rating */}
        <div className="flex items-center space-x-2">
          <div className="flex">
            {renderStars(product.rating)}
          </div>
          <span className="text-sm text-gray-600">({product.rating})</span>
        </div>

        {/* Price */}
        <div className="flex items-center justify-between">
          <span className="text-2xl font-bold text-automotive-blue">
            ${product.price.toFixed(2)}
          </span>
          <button
            onClick={handleAddToCart}
            className="btn-primary text-sm py-1 px-3 flex items-center space-x-1"
          >
            <FaShoppingCart className="text-xs" />
            <span>Add</span>
          </button>
        </div>

        {/* Compatibility */}
        <div className="text-sm text-gray-600">
          <span className="font-medium">Fits:</span> {product.compatibility.slice(0, 2).join(', ')}
          {product.compatibility.length > 2 && ' + more'}
        </div>

        {/* Category */}
        <div className="text-xs text-automotive-orange font-medium">
          {product.category}
        </div>
      </div>
    </div>
  );
};

export default ProductCard;
